using UnityEngine;using System.Collections;public class OwenCharacterController : ControllableCharacter{	// Use this for initialization    protected override void Start()     {        base.Start();	}		// Update is called once per frame	protected override void Update ()     {        base.Update();	}    // Fixed updates is called once per physics update    protected override void FixedUpdate()    {        base.FixedUpdate();    }    // Called when the player enters a collision    protected override void OnCollisionEnter2D(Collision2D collision)    {        base.OnCollisionEnter2D(collision);    }}